import React from 'react'
import Typed from 'react-typed';

const homeText = () => {
  return (
    <div className="home-text">
      <p>Développeur Web passionné, je suis constamment à la recherche d'améliorations, que ce soit à des
        fins personnelles ou professionnelles.
        Dans un monde poussé par l'innovation, la lecture quotidienne et la curiosité semblent obligatoires
        mais, pour moi c'est inné.
                J'ai toujours aimé plonger au plus profond des sujets qui me passionnent.</p>
    </div>
  )
}

export default homeText;
